CREATE DEFINER=`root`@`localhost` PROCEDURE `agregar_producto` (IN `p_nombre_producto` VARCHAR(100), IN `p_descripcion` TEXT, IN `p_precio` DECIMAL(10,2), IN `p_stock` INT, IN `p_id_categoria` INT, IN `p_imagen` LONGBLOB)   BEGIN
    INSERT INTO productos (
        nombre_producto,
        descripcion,
        precio,
        stock,
        id_categoria,
        imagen
        -- No incluimos id_producto porque es AUTO_INCREMENT
        -- No incluimos fecha_registro porque es DEFAULT current_timestamp()
    ) VALUES (
        p_nombre_producto,
        p_descripcion,
        p_precio,
        p_stock,
        p_id_categoria,
        p_imagen
    );
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `buscar_productos_por_nombre` (IN `p_nombre` VARCHAR(100))   BEGIN
    SELECT 
        p.id_producto,
        p.nombre_producto,
        p.descripcion,
        p.precio,
        p.stock,
        p.id_categoria,
        p.imagen,
        p.fecha_registro,
        c.nombre_categoria
    FROM productos p
    LEFT JOIN categorias c ON p.id_categoria = c.id_categoria
    WHERE p.nombre_producto LIKE p_nombre 
       OR p.descripcion LIKE p_nombre
       OR c.nombre_categoria LIKE p_nombre
    ORDER BY p.fecha_registro DESC;
END$$

