CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_editar_categoria` (IN `p_id_categoria` INT, IN `p_nombre_categoria` VARCHAR(100), IN `p_descripcion` TEXT)   BEGIN
    UPDATE categorias 
    SET 
        nombre_categoria = p_nombre_categoria,
        descripcion = p_descripcion
    WHERE 
        id_categoria = p_id_categoria;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_editar_producto` (IN `_id_producto` INT, IN `_nombre` VARCHAR(100), IN `_descripcion` TEXT, IN `_precio` DECIMAL(10,2), IN `_stock` INT, IN `_id_categoria` INT, IN `_imagen` LONGBLOB)   BEGIN
    -- Si _imagen viene con datos, actualizamos TODO
    IF _imagen IS NOT NULL THEN
        UPDATE productos 
        SET 
            nombre_producto = _nombre,
            descripcion = _descripcion,
            precio = _precio,
            stock = _stock,
            id_categoria = _id_categoria,
            imagen = _imagen
        WHERE Id_producto = _id_producto;
        
    -- Si _imagen es NULL (no subieron foto nueva), actualizamos todo MENOS la imagen
    ELSE
        UPDATE productos 
        SET 
            nombre_producto = _nombre,
            descripcion = _descripcion,
            precio = _precio,
            stock = _stock,
            id_categoria = _id_categoria
            -- No tocamos la columna imagen para no borrar la anterior
        WHERE Id_producto = _id_producto;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_editar_usuario` (IN `p_id` INT, IN `p_nombre` VARCHAR(100), IN `p_apellido` VARCHAR(100), IN `p_correo` VARCHAR(100), IN `p_contrasena` VARCHAR(255), IN `p_telefono` VARCHAR(15), IN `p_direccion` VARCHAR(200), IN `p_rol` VARCHAR(20))   BEGIN
    UPDATE usuarios 
    SET 
        nombre = p_nombre,
        apellido = p_apellido,
        correo = p_correo,
        -- Lógica PRO: Solo actualiza la contraseña si el usuario escribió algo nuevo
        contrasena = IF(p_contrasena IS NOT NULL AND p_contrasena != '', p_contrasena, contrasena),
        telefono = p_telefono,
        direccion = p_direccion,
        rol = p_rol
    WHERE id_usuario = p_id;
END$$

